import { Box } from "@mui/material";
import {Items} from './Items';

export const Home = () => {
  return (
    <div style={{ width: '100%' }}>
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'nowrap',
        p: 1,
        m: 1,
        bgcolor: 'background.paper',
        maxWidth: 300,
        borderRadius: 1,
      }}
    >
      <Items/>
    </Box>
  </div>
  );
};
